import React, { Component } from "react";
import "./App.css";
import { Animated } from "react-animated-css";
import { Provider } from "react-redux";
import Suggest from "./components/TextFields/Autosuggest";
import store from "./Store/Store";

class App extends Component {
  render() {
    return (
      <Provider store={store}>
        <React.Fragment>
          <div className="ShowCase">
            <Animated
              animationIn="fadeInRight"
              animationOut="fadeOut"
              isVisible={true}
            >
              <h1>Museum Locale</h1>
            </Animated>
            <p>
              <strong>Your Local Museum</strong>
            </p>
          </div>
          <img
            className="Icons"
            src="https://pbs.twimg.com/profile_images/472484809390845952/al5G_CPq_400x400.jpeg"
            alt="TheMet"
          />
          <img
            className="Icons"
            src="http://blogs.newschool.edu/arts-social-engagement/files/2018/05/met.jpg"
            alt="TheMet"
          />
          <img
            className="Icons"
            src="https://upload.wikimedia.org/wikipedia/commons/f/fc/Artsy_logo.svg"
            alt="TheMet"
          />
        </React.Fragment>
      </Provider>
    );
  }
}

export default App;
